import { signUpUser } from "./4-user-promise"
import { uploadPhoto } from "./5-photo-reject"

export default async function handleProfileSignup(firstName, lastName, fileName){
    const singup = await signUpUser(firstName, lastName).then(data => ({
        status: 'fulfilled',
        value: data
    }));

    const upload = await uploadPhoto(fileName).then(err => ({
        status: 'rejected',
        value: err.toString()
    }));

    return Promise.resolve([singup, upload]);
}

